          <Jumbotron.Pane>
            <Jumbotron.Title>{item.title}</Jumbotron.Title>
            <Jumbotron.SubTitle>{item.subTitle}</Jumbotron.SubTitle>
          </Jumbotron.Pane>
          <Jumbotron.Pane>
            <Jumbotron.Image src={it}/>
          </Jumbotron.Pane>
        </Jumbotron>
      )) }
    </Jumbotron.Container>

  );
}

